def FUN_AUTO_INITIAL(device) :                                                                      #[FUN/AUTO_INITIAL]
    device.Message("BEF Initial...")                                                                #MESSAGE  = "BEF Initial..."
    device.DelayMS(5)                                                                               #DELAYMS  = 5
    wregList=[0x5a, 0x5a]; device.WREG0_39(0x9F, 2, wregList)                                       #WREG0  = 0x39, 0x9F, 0x5A, 0x5A ; Level 1 key ON (UCS)
    wregList=[0x5a, 0x5a]; device.WREG0_39(0xF0, 2, wregList)                                       #WREG0  = 0x39, 0xF0, 0x5A,0x5A ; Level 2 key ON (MCS)
    wregList=[0x5a, 0x5a]; device.WREG0_39(0xFC, 2, wregList)                                       #WREG0  = 0x39, 0xFC, 0x5A,0x5A ; Level 2 Key ON, OTP COUNT Reading
    device.WREG0_15(0xB0, 0x09)                                                                     #WREG0  = 0x15, 0xB0, 0x09
    device.WREG0_15(0xFB, 0x08)                                                                     #WREG0  = 0x15, 0xFB, 0x08
    FUN_OTP_REGISTER_SET(device)                                                                    #FUN/OTP_REGISTER_SET
    FUN_LTPS_GAMMA_UPDATE(device)                                                                   #FUN/LTPS_GAMMA_UPDATE
    device.DelayMS(5)                                                                               #DELAYMS  = 5
    device.WREG0_05(0x11)                                                                           #WREG0  = 0x05, 0x11  ; Sleep out
    device.DelayMS(5)                                                                               #DELAYMS  = 5
    device.SendTxtCmd("PATTERN0=0,1,1")                                                             #PATTERN0 = 0,1,1
    device.Message("Brightness Control.")                                                           #MESSAGE  = "Brightness Control."
    device.WREG0_15(0x53, 0x20)                                                                     #WREG0  = 0x15, 0x53, 0x20 ; Brightness Control ON
    wregList=[0x03, 0xff]; device.WREG0_39(0x51, 2, wregList)                                       #WREG0  = 0x39, 0x51, 0x03, 0xFF
    wregList=[0x00]; device.WREG0_39(0x35, 1, wregList)                                             #WREG0  = 0x39, 0x35, 0x00
    wregList=[0x10]; device.WREG0_39(0x60, 1, wregList)                                             #WREG0  = 0x39, 0x60, 0x10 ;FQ_SEL  90Hz 구동
    device.DelayMS(130)                                                                             #DELAYMS  = 130   ; 3fc2 임시 delay
    FUN_OTP_REGISTER_SET(device)                                                                    #FUN/OTP_REGISTER_SET
    FUN_LTPS_GAMMA_UPDATE(device)                                                                   #FUN/LTPS_GAMMA_UPDATE
    FUN_DEF_GAMMA_SET(device)                                                                       #FUN/DEF_GAMMA_SET
    device.WREG0_05(0x29)                                                                           #WREG0  = 0x05, 0x29  ;Display on
    device.Message("Display On.")                                                                   #MESSAGE  = "Display On."
    wregList=[0x5a, 0x5a]; device.WREG0_39(0xFC, 2, wregList)                                       #WREG0  = 0x39, 0xFC, 0x5A,0x5A ; Level 2 Key ON, OTP COuNT Reading
    wregList=[0x5a, 0x5a]; device.WREG0_39(0xF0, 2, wregList)                                       #WREG0  = 0x39, 0xF0, 0x5A, 0x5A ; RESET 후 Register F0h 접근 제한 되어 풀어주는 코드 추가
    device.Message("AUTO_INITIAL OK")                                                               #MESSAGE  = "AUTO_INITIAL OK"
    device.SendTxtCmd("PATTERN0=0,1,1")                                                             #PATTERN0 = 0,1,1

def FUN_AUTO_INITIAL2(device) :                                                                     #[FUN/AUTO_INITIAL2]
    device.Message("AFT Initial...")                                                                #MESSAGE  = "AFT Initial..."
    device.SendTxtCmd("DSI_ENHSCLK=OFF")                                                            #DSI_ENHSCLK = OFF   ; LP11
    device.DelayMS(5)                                                                               #DELAYMS  = 5
    device.SendTxtCmd("SPI_CFG=OFF,SW,4LINE")                                                       #SPI_CFG  = OFF, SW, 4LINE
    device.DelayMS(50)                                                                              #DELAYMS  = 50
    wregList=[0x5a, 0x5a]; device.WREG0_39(0x9F, 2, wregList)                                       #WREG0  = 0x39, 0x9F, 0x5A, 0x5A ; Level 1 key ON (UCS)
    wregList=[0x5a, 0x5a]; device.WREG0_39(0xF0, 2, wregList)                                       #WREG0  = 0x39, 0xF0, 0x5A,0x5A ; Level 2 key ON (MCS)
    wregList=[0x5a, 0x5a]; device.WREG0_39(0xFC, 2, wregList)                                       #WREG0  = 0x39, 0xFC, 0x5A,0x5A ; Level 2 Key ON, OTP COUNT Reading
    device.WREG0_05(0x11)                                                                           #WREG0  = 0x05, 0x11  ; Sleep out
    device.DelayMS(5)                                                                               #DELAYMS  = 5   ; IC spec상 5ms이나 1frame 이상 추천
    device.SendTxtCmd("PATTERN0=0,1,1")                                                             #PATTERN0 = 0,1,1
    device.WREG0_15(0x35, 0x00)                                                                     #WREG0  = 0x15, 0x35, 0x00 ; TE ON, 3/13 추가
    device.Message("Brightness Control.")                                                           #MESSAGE  = "Brightness Control."
    device.WREG0_15(0x53, 0x20)                                                                     #WREG0  = 0x15, 0x53, 0x20 ; Brightness Control ON
    wregList=[0x03, 0xff]; device.WREG0_39(0x51, 2, wregList)                                       #WREG0  = 0x39, 0x51, 0x03, 0xFF
    wregList=[0x10]; device.WREG0_39(0x60, 1, wregList)                                             #WREG0  = 0x39, 0x60, 0x10 ;FQ_SEL  90Hz 구동
    device.DelayMS(80)                                                                              #DELAYMS  = 80
    device.WREG0_05(0x29)                                                                           #WREG0  = 0x05, 0x29
    device.Message("Display On.")                                                                   #MESSAGE  = "Display On."
    device.Message("AUTO_INITIAL AFTER OK")                                                         #MESSAGE  = "AUTO_INITIAL AFTER OK"
    device.WREG0_05(0x35)                                                                           #WREG0  = 0x05, 0x35
    device.SendTxtCmd("PATTERN0=0,1,1")                                                             #PATTERN0 = 0,1,1
    device.SendTxtCmd("SPI_CFG=ON,SW,4LINE")                                                        #SPI_CFG  = ON, SW, 4LINE

