def FUN_CYL_OFF(device) :                                                                           #[FUN/CYL_OFF]
    if IF_STATE[9]==1 : FUN_CYL_OFF_W2(device)                                                      #IF_STATE = 9, 1, CYL_OFF_W2
    if IF_STATE[9]==2 : FUN_CYL_OFF_W2(device)                                                      #IF_STATE = 9, 2, CYL_OFF_W2
    if IF_STATE[9]==3 : FUN_CYL_OFF_MIT(device)                                                     #IF_STATE = 9, 3, CYL_OFF_MIT
    if IF_STATE[9]==4 : FUN_CYL_OFF_MIT(device)                                                     #IF_STATE = 9, 4, CYL_OFF_MIT
    if IF_STATE[9]==5 : FUN_CYL_OFF_MIT(device)                                                     #IF_STATE = 9, 5, CYL_OFF_MIT
    if IF_STATE[9]==6 : FUN_CYL_OFF_MIT(device)                                                     #IF_STATE = 9, 6, CYL_OFF_MIT
    if IF_STATE[9]==7 : FUN_CYL_OFF_MIT(device)                                                     #IF_STATE = 9, 7, CYL_OFF_MIT ; POC 2.0
    if IF_STATE[9]==8 : FUN_CYL_OFF_MIT(device)                                                     #IF_STATE = 9, 8, CYL_OFF_MIT ; POC 51G

def FUN_CYL_OFF_MIT(device) :                                                                       #[FUN/CYL_OFF_MIT]
    device.SendTxtCmd("SOL3=L")                                                                     #SOL3  = L   ;AMT OneSocket Up
    device.DelayMS(300)                                                                             #DELAYMS  = 300
    device.SendTxtCmd("SOL1=L")                                                                     #SOL1  = L   ;FORWARD
    device.SendTxtCmd("SOL2=H")                                                                     #SOL2  = H   ;BACKWARD

def FUN_CYL_OFF_W2(device) :                                                                        #[FUN/CYL_OFF_W2]
    device.SendTxtCmd("SOL2=L")                                                                     #SOL2  = L   ;Manual OneSocket Down
    device.DelayMS(100)                                                                             #DELAYMS  = 100
    device.SendTxtCmd("SOL1=L")                                                                     #SOL1  = L   ;AMT OneSocket Down
    device.DelayMS(100)                                                                             #DELAYMS  = 100

def FUN_CYL_ON(device) :                                                                            #[FUN/CYL_ON]
    if IF_STATE[9]==1 : FUN_CYL_ON_W2(device)                                                       #IF_STATE = 9, 1, CYL_ON_W2
    if IF_STATE[9]==2 : FUN_CYL_ON_W2(device)                                                       #IF_STATE = 9, 2, CYL_ON_W2
    if IF_STATE[9]==3 : FUN_CYL_ON_MIT(device)                                                      #IF_STATE = 9, 3, CYL_ON_MIT
    if IF_STATE[9]==4 : FUN_CYL_ON_MIT(device)                                                      #IF_STATE = 9, 4, CYL_ON_MIT
    if IF_STATE[9]==5 : FUN_CYL_ON_MIT(device)                                                      #IF_STATE = 9, 5, CYL_ON_MIT
    if IF_STATE[9]==6 : FUN_CYL_ON_MIT(device)                                                      #IF_STATE = 9, 6, CYL_ON_MIT
    if IF_STATE[9]==7 : FUN_CYL_ON_MIT(device)                                                      #IF_STATE = 9, 7, CYL_ON_MIT ; POC2.0
    if IF_STATE[9]==8 : FUN_CYL_ON_MIT(device)                                                      #IF_STATE = 9, 8, CYL_ON_MIT ; POC 51G

def FUN_CYL_ON_MIT(device) :                                                                        #[FUN/CYL_ON_MIT]
    device.SendTxtCmd("SOL1=H")                                                                     #SOL1  = H   ;FORWARD
