def FUN_ERROR_MSG(device) :                                                                         #[FUN/ERROR_MSG]
    if IF_STATE[9]==1 : FUN_ERROR_MSG_MANUAL(device)                                                #IF_STATE = 9, 1, ERROR_MSG_MANUAL
    if IF_STATE[9]==2 : FUN_ERROR_MSG_MANUAL(device)                                                #IF_STATE = 9, 2, ERROR_MSG_MANUAL
    if IF_STATE[9]==3 : FUN_AMT_IDCHK_NG(device)                                                    #IF_STATE = 9, 3, AMT_IDCHK_NG ;AMT
    if IF_STATE[9]==4 : FUN_AFT_IDCHK_NG(device)                                                    #IF_STATE = 9, 4, AFT_IDCHK_NG ;AFT
    if IF_STATE[9]==5 : FUN_AFT_IDCHK_NG(device)                                                    #IF_STATE = 9, 5, AFT_IDCHK_NG ;AFTM
    if IF_STATE[9]==6 : FUN_ERROR_MSG_MANUAL(device)                                                #IF_STATE = 9, 6, ERROR_MSG_MANUAL ;SAFT
