def FUN_ERROR_MSG_MANUAL(device) :                                                                  #[FUN/ERROR_MSG_MANUAL]
    FUN_PTRN_RED(device)                                                                            #FUN/PTRN_RED
    device.SendTxtCmd("RREGSET=1,0xAE")                                                             #RREGSET  = 1, 0xAE
    device.SendTxtCmd("RREG0=0xDA,1,ON,\"ID1\",1")                                                  #RREG0  = 0xDA, 1, ON, "ID1",1
    device.SendTxtCmd("RREGSET=1,0xFF")                                                             #RREGSET  = 1, 0xFF
    device.SendTxtCmd("RREG0=0xDB,1,ON,\"ID2\",2")                                                  #RREG0  = 0xDB, 1, ON, "ID2",2
    device.SendTxtCmd("RREGSET=1,0x01")                                                             #RREGSET  = 1, 0x01
    device.SendTxtCmd("RREG0=0xDC,1,ON,\"ID3\",3")                                                  #RREG0  = 0xDC, 1, ON, "ID3",3
    device.PTRN_SET("Write,0")                                                                      #PTRN_SET = Write, 0
    device.SendTxtCmd("NEXTLOCK=ON")                                                                #NEXTLOCK = ON
    device.SendTxtCmd("ANTI_KEY_COLLECT=ON")                                                        #ANTI_KEY_COLLECT = ON

