def FUN_FLASH_ID_CHECK(device) :                                                                    #[FUN/FLASH_ID_CHECK]
    device.Message("FLASH_ID_WINBOND_CHECK")                                                        #MESSAGE  = "FLASH_ID_WINBOND_CHECK"
    FUN_SLEEP_IN(device)                                                                            #FUN/SLEEP_IN
