def FUN_FLASH_SETTING_COMMON(device) :                                                              #[FUN/FLASH_SETTING_COMMON]
    device.Message("FLASH_SETTING_COMMON")                                                          #MESSAGE  = "FLASH_SETTING_COMMON"
    FUN_FLASH_SETTING_SPI(device)                                                                   #FUN/FLASH_SETTING_SPI
    device.SendTxtCmd("EEP_25Q4_CONFIG=WRITE_BEF_FUN,FLASH_ID_CHECK")                               #EEP_25Q4_CONFIG = WRITE_BEF_FUN, FLASH_ID_CHECK ; Flash Write 전 Funtion(ID Check, SPI Single Status Reg. Writing)
    device.SendTxtCmd("EEP_25Q4_CONFIG=WRITE_OK_FUN,FLASH_SR_WRITE_QUAD")                           #EEP_25Q4_CONFIG = WRITE_OK_FUN, FLASH_SR_WRITE_QUAD ; Flash Write OK Funtion(SPI QUAD Status Reg. Writing)
    device.SendTxtCmd("EEP_25Q4_CONFIG=WRITE_NG_FUN,FLASH_WRITE_NG")                                #EEP_25Q4_CONFIG = WRITE_NG_FUN, FLASH_WRITE_NG ; Flash Write NG Funtion
    device.SendTxtCmd("EEP_25Q4_CONFIG=WRITE_STATE_CHK,ON,1,10,us,0")                               #EEP_25Q4_CONFIG = WRITE_STATE_CHK, ON, 1, 10, us, 0 ; State Check ON/OFF, State Check 반복시 Delay, 체크 하는 Count, Delay ms/us 설정, Check 완료 후 Delay
    device.SendTxtCmd("EEP_25Q4_CONFIG=WRITE_DELAY,0,0")                                            #EEP_25Q4_CONFIG = WRITE_DELAY, 0, 0 ; EEP WRITE 시 실행할 Delay 설정, T2는 ms, T5는 us 단위, EEP WRITE 중 Status Check대신 Delay 처리 할 때 Delay설정
    device.SendTxtCmd("EEP_25Q4_CONFIG=STATE_CHK,ON,10000,0,us,0,0")                                #EEP_25Q4_CONFIG = STATE_CHK, ON, 10000, 0, us, 0, 0 ; Erase시 State Check ON/OFF, State Check Max Count, Check 반복 시 Delay,Delay ms/us 설정, Check 완료 후 Delay, 체크 하는 최소 Count 설정
    FUN_FLASH_SETTING_MCA(device)                                                                   #FUN/FLASH_SETTING_MCA   ; MCA 조건 Default로 사용

