    device.SendTxtCmd("EEP_25Q4_CONFIG=AUTO_FILE_DEL,OFF")                                          #EEP_25Q4_CONFIG = AUTO_FILE_DEL, OFF ;poc vector 파일 자동 삭제
    device.SendTxtCmd("EEP_25Q4_CONFIG=SPI_SPEED,2,2,2")                                            #EEP_25Q4_CONFIG = SPI_SPEED, 2, 2, 2 ; 2번째 Param SW 속도에서 사용, 3번째 HW 속도에서 사용
    device.SendTxtCmd("EEP_25Q4_CONFIG=\"CH_CFG\",0x40")                                            #EEP_25Q4_CONFIG = "CH_CFG", 0x40
    device.SendTxtCmd("EEP_25Q4_CONFIG=\"FB_CLK_SEL\",0x03")                                        #EEP_25Q4_CONFIG = "FB_CLK_SEL", 0x03
