    device.SendTxtCmd("EEP_25Q4_CONFIG=\"MODE_CFG\",0x00")                                          #EEP_25Q4_CONFIG = "MODE_CFG", 0x00
    device.SendTxtCmd("EEP_25Q4_CONFIG=\"PENDING_CLR_REG\",0x1f")                                   #EEP_25Q4_CONFIG = "PENDING_CLR_REG", 0x1f
    device.SendTxtCmd("EEP_25Q4_CONFIG=SWSPI_MODE,ON")                                              #EEP_25Q4_CONFIG = SWSPI_MODE, ON ; SPI SW MODE ON, OFF(OFF시 HW)
    device.SendTxtCmd("EEP_25Q4_CONFIG=WRITE_BEF_FUN,FLASH_ID_WINBOND_CHECK_OPEC")                  #EEP_25Q4_CONFIG = WRITE_BEF_FUN, FLASH_ID_WINBOND_CHECK_OPEC ; POC Write 전 Funtion 실행
    device.SendTxtCmd("EEP_25Q4_CONFIG=WRITE_OK_FUN,FLASH_ID_WINBOND_CHECK_FOR_QUAD_OPEC")          #EEP_25Q4_CONFIG = WRITE_OK_FUN, FLASH_ID_WINBOND_CHECK_FOR_QUAD_OPEC ; POC Write OK Funtion 실행
    device.SendTxtCmd("EEP_25Q4_CONFIG=WRITE_NG_FUN,FLASH_WRITE_NG_OPEC")                           #EEP_25Q4_CONFIG = WRITE_NG_FUN, FLASH_WRITE_NG_OPEC ; POC Write NG Funtion 실행
    device.SendTxtCmd("EEP_25Q4_CONFIG=BINFILE_SELECT,OFF")                                         #EEP_25Q4_CONFIG = BINFILE_SELECT, OFF ; OFF 벡터파일 HEX --> ON 벡터파일 BIN
    FUN_FLASH_CHKSUM_CHECK_OPEC(device)                                                             #FUN/FLASH_CHKSUM_CHECK_OPEC  ; Checksum_check
