    device.SendTxtCmd("EEP_25Q4_WRITE=0x01,0x00")                                                   #EEP_25Q4_WRITE = 0x01, 0x00  ; Status reg. size : Winbond(2byte), JEJU/Maxcronix(1bite : 0x01, 0x00)
    device.DelayMS(10)                                                                              #DELAYMS  = 10
    device.SendTxtCmd("EEP_25Q4_READSET=0x00")                                                      #EEP_25Q4_READSET = 0x00
    device.SendTxtCmd("EEP_25Q4_READ=0x05,1,FLASH_ERASE,FLASH_STATUS_NG")                           #EEP_25Q4_READ = 0x05, 1, FLASH_ERASE, FLASH_STATUS_NG

