    device.SendTxtCmd("EEP_25Q4_WRITE=0x01,0x00,0x00")                                              #EEP_25Q4_WRITE = 0x01, 0x00, 0x00 ; Status reg. size : Winbond(2byte), JEJU/Maxcronix(1bite : 0x01, 0x00)
