    device.SendTxtCmd("DEFAULT_GAMMA=10")                                                           #DEFAULT_GAMMA = 10   ; 알고리즘 수행을 위한 Gamma 지정 / SPEC_SET 뒤에 위치해야 함, 이전 감마 offset 초기화, Fixed Gamma가 아닌 Default Gamma Load 하는 역활
