    device.SendTxtCmd("AVERAGE_SET")                                                                #AVERAGE_SET    ; Smart MTP 시 누적 평균 gamma 반영
    device.SendTxtCmd("SMTP_RUN=0,1,1")                                                             #SMTP_RUN = 0, 1, 1  ; MTP point V255 / Searching / Before measure
    device.SendTxtCmd("SMTP_RUN=1,1,0")                                                             #SMTP_RUN = 1, 1, 0  ; MTP point V203 / Searching / Before No measure
    device.SendTxtCmd("SMTP_RUN=2,1,0")                                                             #SMTP_RUN = 2, 1, 0  ; MTP point V151 / Searching / Before No measure
    device.SendTxtCmd("SMTP_RUN=3,1,0")                                                             #SMTP_RUN = 3, 1, 0  ; MTP point V87  / Searching / Before measure
    device.SendTxtCmd("SMTP_RUN=4,1,0")                                                             #SMTP_RUN = 4, 1, 0  ; MTP point V51  / Searching / Before No measure
    device.SendTxtCmd("SMTP_RUN=5,1,0")                                                             #SMTP_RUN = 5, 1, 0  ; MTP point V35  / Searching / Before No measure
    device.SendTxtCmd("SMTP_RUN=6,1,0")                                                             #SMTP_RUN = 6, 1, 0  ; MTP point V23  / Searching / Before No measure
    device.SendTxtCmd("SMTP_RUN=7,1,0")                                                             #SMTP_RUN = 7, 1, 0  ; MTP point V11  / Searching / Before No measure
    device.SendTxtCmd("SMTP_RUN=8,1,0")                                                             #SMTP_RUN = 8, 1, 0  ; MTP point V7  / Searching / Before No measure
    wregList=[0x07, 0xff]; device.WREG0_39(0x51, 2, wregList)                                       #WREG0  = 0x39, 0x51, 0x07, 0xFF
    device.SendTxtCmd("LUMI_STEP_RUN=1,0x08,1")                                                     #LUMI_STEP_RUN = 1, 0x08, 1
