def FUN_POC_VECTOR_NG(device) :                                                                     #[FUN/POC_VECTOR_NG]
    device.Message("POC_VEC_NG")                                                                    #MESSAGE  = "POC_VEC_NG"
    FUN_PTRN_RED(device)                                                                            #FUN/PTRN_RED
    device.PTRN_SET("Write,0")                                                                      #PTRN_SET = Write, 0
    device.DelayMS(100)                                                                             #DELAYMS  = 100
    device.SendTxtCmd("TEXTOUT=50,600,0x0000FF00,0x000000,180,\"POC NG\"")                          #TEXTOUT  = 50, 600, 0x0000FF00, 0x000000, 180, "POC NG"
    device.PTRN_SET("Write,0")                                                                      #PTRN_SET = Write, 0
    device.DelayMS(100)                                                                             #DELAYMS  = 100
    FUN_RCV_CMD_POC_VECTOR_NG(device)                                                               #FUN/RCV_CMD_POC_VECTOR_NG
    device.SendTxtCmd("DNSENDEND=1,1,1")                                                            #DNSENDEND = 1,1,1
    device.SendTxtCmd("ANTI_KEY_COLLECT=ON")                                                        #ANTI_KEY_COLLECT = ON
    device.SendTxtCmd("NEXTLOCK=ON")                                                                #NEXTLOCK = ON
    device.SendTxtCmd("TEST_STOP")                                                                  #TEST_STOP

