def FUN_SENSOR_CENTER_CHECK(device) :                                                               #[FUN/SENSOR_CENTER_CHECK]
    device.SendTxtCmd("DATA_RESULT=ON")                                                             #DATA_RESULT = ON
    if IF_STATE[DID0]==(DID1%200==0) : FUN_SENSOR_CENTER_CHK_RUN(device)                             #IF_STATE = DID0 , ( DID1 % 200 = 0 ) , SENSOR_CENTER_CHK_RUN ;100번에 1번 CHECK
    DID1=(DID1+1)                                                                                   #DATA_SET = DID1, ( DID1 + 1 )

def FUN_SENSOR_CENTER_CHK_RUN(device) :                                                             #[FUN/SENSOR_CENTER_CHK_RUN]
    device.SendTxtCmd("SENSOR_SET")                                                                 #SENSOR_SET
    device.SendTxtCmd("SENSOR_DATE=15")                                                             #SENSOR_DATE = 15
    device.SendTxtCmd("BG7000_MATERIAL_CHECK=0x05")                                                 #BG7000_MATERIAL_CHECK = 0x05  ; DAISY : 1 , LILY : 2 , SALVIA : 3  각각의 유기재료에 맞는 CODE 추가 A50 DAISY
    FUN_PTRN_SENSOR_CENTER(device)                                                                  #FUN/PTRN_SENSOR_CENTER
    FUN_NORMAL_LXY_LIMIT(device)                                                                    #FUN/NORMAL_LXY_LIMIT
    device.Message("Sensor Center Check Start!!")                                                   #MESSAGE  = "Sensor Center Check Start!!"
    device.SendTxtCmd("LXY_SPEC_SET=LSPEC,0.2,-1000")                                               #LXY_SPEC_SET = LSPEC, 0.2, -1000 ;MAX, MIN
    device.SendTxtCmd("LXY_SPEC_CHECK=3,50,\"SENSOR_CENTER_CHECK\"")                                #LXY_SPEC_CHECK = 3, 50, "SENSOR_CENTER_CHECK"
    device.SendTxtCmd("RCV_CMD=CHECK,STATE,RunStateOK,RunStateNG")                                  #RCV_CMD  = CHECK, STATE, RunStateOK, RunStateNG
    device.SendTxtCmd("DNSENDEND=0,1,0")                                                            #DNSENDEND = 0,1,0

