def FUN_SLEEP_IN(device) :                                                                          #[FUN/SLEEP_IN]
    device.WREG0_05(0x28)                                                                           #WREG0  = 0x05, 0x28  ; Display Off
    device.DelayMS(35)                                                                              #DELAYMS  = 35
    device.WREG0_05(0x10)                                                                           #WREG0  = 0x05, 0x10  ; Sleep in
    device.DelayMS(120)                                                                             #DELAYMS  = 120
    device.Message("NORMAL SLEEP IN")                                                               #MESSAGE  = "NORMAL SLEEP IN"

def FUN_SLEEP_OUT(device) :                                                                         #[FUN/SLEEP_OUT]
    device.DelayMS(20)                                                                              #DELAYMS  = 20
    device.WREG0_05(0x11)                                                                           #WREG0  = 0x05, 0x11  ; Sleep out
    device.DelayMS(100)                                                                             #DELAYMS  = 100
    FUN_PTRN_BLACK(device)                                                                          #FUN/PTRN_BLACK
    device.WREG0_05(0x29)                                                                           #WREG0  = 0x05, 0x29  ; Display on
    device.DelayMS(100)                                                                             #DELAYMS  = 100   ; DTC_DISP_ON delay
    device.Message("NORMAL SLEEP OUT")                                                              #MESSAGE  = "NORMAL SLEEP OUT"

