def FUN_SP_MTP_CHECK(device) :                                                                      #[FUN/SP_MTP_CHECK]
    device.Message("SP_OTP_CHECK")                                                                  #MESSAGE  = "SP_OTP_CHECK"
    wregList=[0x5a, 0x5a]; device.WREG0_39(0xF0, 2, wregList)                                       #WREG0  = 0x39, 0xF0, 0x5A, 0x5A
    wregList=[0x5a, 0x5a]; device.WREG0_39(0xFC, 2, wregList)                                       #WREG0  = 0x39, 0xFC, 0x5A, 0x5A
    device.SendTxtCmd("DSI_HSLP=LP")                                                                #DSI_HSLP = LP
    device.DelayMS(10)                                                                              #DELAYMS  = 10
    device.SendTxtCmd("RREG0=0xB8,7")                                                               #RREG0  = 0xB8, 7  ;SLL Dummy Read
    device.Message("SP_ON Code Check")                                                              #MESSAGE  = "SP_ON Code Check"
    device.SendTxtCmd("RREGSET=1,0x02")                                                             #RREGSET  = 1, 0x02
    device.SendTxtCmd("RREG0=0xBE,1,OFF,\"BEh\",1")                                                 #RREG0  = 0xBE, 1, OFF, "BEh",1
    device.SendTxtCmd("READ_IF=1,TRUE,SP_VEC_CHECK")                                                #READ_IF  = 1, TRUE, SP_VEC_CHECK
    device.SendTxtCmd("READ_IF=1,FALSE,SP_MTP_NG")                                                  #READ_IF  = 1, FALSE, SP_MTP_NG
    wregList=[0xa5, 0xa5]; device.WREG0_39(0xFC, 2, wregList)                                       #WREG0  = 0x39, 0xFC, 0xA5, 0xA5

