def FUN_TESTER_INIT(device) :                                                                       #[FUN/TESTER_INIT]
    FUN_RESET(device)                                                                               #FUN/RESET
    device.SendTxtCmd("SYNAPTICS_DRAW=OFF")                                                         #SYNAPTICS_DRAW = OFF
    device.SendTxtCmd("AMPCHK=OFF")                                                                 #AMPCHK  = OFF   ; 601NN01 PIN MAP
    device.SendTxtCmd("EXT_CFG=EXT1,OUT")                                                           #EXT_CFG  = EXT1, OUT  ; EXT1 OUTDIR   <== RESET
    device.SendTxtCmd("EXT_CFG=EXT2,IN")                                                            #EXT_CFG  = EXT2, IN  ; EXT2 OUTDIR  <== TE
    device.SendTxtCmd("EXT_CFG=EXT3,IN")                                                            #EXT_CFG  = EXT3, IN  ; EXT3 OUTDIR  <== ERR_FG
    device.SendTxtCmd("EXT_CFG=EXT4,IN")                                                            #EXT_CFG  = EXT4, IN  ; EXT4 OUTDIR   <== TOUCH INT 핀
    device.SendTxtCmd("EXT_CFG=EXT5,OUT")                                                           #EXT_CFG  = EXT5, OUT  ; EXT5 OUTDIR  <== TSP RESET 핀
    device.SendTxtCmd("EXT_CFG=EXT6,OUT")                                                           #EXT_CFG  = EXT6, OUT  ; EXT6 OUTDIR  <== MAGANA SEL ( MAGANA IC 사용시 )  / S.LSI PWM_OUT PIN사용
    device.SendTxtCmd("EXT_CFG=EXT7,OUT")                                                           #EXT_CFG  = EXT7, OUT  ; EXT7 OUTDIR  SDA
    device.SendTxtCmd("EXT_CFG=EXT8,OUT")                                                           #EXT_CFG  = EXT8, OUT  ; EXT8 OUTDIR  SCL
    device.SendTxtCmd("EXT_CFG=EXT9,OUT")                                                           #EXT_CFG  = EXT9, OUT  ; POC RELAY SW ( SPI SEL )
    device.SendTxtCmd("EXT_CFG=EXT10,OUT")                                                          #EXT_CFG  = EXT10, OUT  ; ELVDD SENSSING B/D VOUT2 SW
    device.SendTxtCmd("EXT=0x00")                                                                   #EXT  = 0x00   ; ALL LOW
    device.SendTxtCmd("RGB_DISPLAY=OFF")                                                            #RGB_DISPLAY = OFF
    device.SendTxtCmd("DSI_ENHSCLK=OFF")                                                            #DSI_ENHSCLK = OFF
    device.SendTxtCmd("BUSDIR=IN,IN")                                                               #BUSDIR  = IN, IN
    device.SendTxtCmd("GPEN=OFF")                                                                   #GPEN  = OFF
    device.SendTxtCmd("DSI_STOP")                                                                   #DSI_STOP
    FUN_POWER_OFF(device)                                                                           #FUN/POWER_OFF

